import "./App.css";
import { useForm } from "react-hook-form";
import TextField from "@mui/material/TextField";
import FormControl from "@mui/material/FormControl";

function App() {
  const {
    register,
    handleSubmit,
    watch,
    formState: { errors },
  } = useForm();
  const onSubmit = (data) => console.log(data);

  return (
    <div className="body">
      <div className="formWrapper">
        <h1 className="title">React forms hook</h1>
        <form onSubmit={handleSubmit(onSubmit)}>
          <TextField
            fullWidth
            error={errors.exampleRequired}
            id="name"
            label="Name"
            {...register("exampleRequired2", { required: true, min: 3 })}
            helperText={errors.exampleRequired && "Field required"}
          />

          <input type="submit" />
        </form>
      </div>
    </div>
  );
}

export default App;
